import logo from './logo.svg';
import './App.css';
import MultiPlayer from './MultiPlayer';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <iframe width="100%" height="300" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/140308123&color=%23ff5500&auto_play=false&hide_related=false&show_comments=true&show_user=true&show_reposts=false&show_teaser=true&visual=true"></iframe>
        <div style="font-size: 10px; color: #cccccc;line-break: anywhere;word-break: normal;overflow: hidden;white-space: nowrap;text-overflow: ellipsis; font-family: Interstate,Lucida Grande,Lucida Sans Unicode,Lucida Sans,Garuda,Verdana,Tahoma,sans-serif;font-weight: 100;">
          <a href="https://soundcloud.com/minecraft-soundtrack" title="Minecraft Soundtrack" target="_blank" style="color: #cccccc; text-decoration: none;">Minecraft Soundtrack</a> Â· <a href="https://soundcloud.com/minecraft-soundtrack/ward" title="Ward" target="_blank" style="color: #cccccc; text-decoration: none;">Ward</a></div>
      </header>
    </div>
  );
}

export default App;
